import React from "react";

export default function Navbar() {
  const navStyle = {
    width: '100%',
    backgroundColor: '#1f2937',
    color: 'white',
    position: 'fixed',
    top: 0,
    left: 0,
    zIndex: 50,
    boxShadow: '0 4px 6px -1px rgba(0, 0, 0, 0.1)'
  };

  const containerStyle = {
    maxWidth: '1200px',
    margin: '0 auto',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '12px 24px'
  };

  const brandStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '12px'
  };

  const logoStyle = {
    width: '40px',
    height: '40px',
    borderRadius: '8px',
    objectFit: 'contain'
  };

  const brandTextStyle = {
    lineHeight: '1.2'
  };

  const titleStyle = {
    fontSize: '18px',
    fontWeight: 'bold',
    color: '#10b981',
    margin: 0
  };

  const subtitleStyle = {
    fontSize: '13px',
    color: '#d1d5db',
    margin: 0
  };

  const navLinksStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '32px'
  };

  const linkStyle = {
    color: 'white',
    textDecoration: 'none',
    fontSize: '14px',
    fontWeight: '500',
    transition: 'color 0.2s ease'
  };

  const actionsStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '16px'
  };

  const buttonStyle = {
    backgroundColor: '#16a34a',
    color: 'white',
    padding: '8px 16px',
    borderRadius: '8px',
    textDecoration: 'none',
    fontSize: '14px',
    fontWeight: '500',
    border: 'none',
    cursor: 'pointer',
    transition: 'background-color 0.2s ease'
  };

  return (
    <nav style={navStyle}>
      <div style={containerStyle}>
        
        {/* Left: Logo + Brand */}
        <div style={brandStyle}>
          <img
            src="/logoagri.png"
            alt="AgriSmartAI Logo"
            style={logoStyle}
          />
          <div style={brandTextStyle}>
            <h1 style={titleStyle}>AgriSmartAI</h1>
            <p style={subtitleStyle}>AI assistant for farmers</p>
          </div>
        </div>

        {/* Center: Main Navigation */}
        <div style={navLinksStyle}>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Home
          </a>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Docs
          </a>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Services
          </a>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            API
          </a>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Dashboard
          </a>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Pricing
          </a>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Contact
          </a>
        </div>

        {/* Right: Action Buttons */}
        <div style={actionsStyle}>
          <a href="#" style={linkStyle} onMouseEnter={(e) => e.target.style.color = '#10b981'} onMouseLeave={(e) => e.target.style.color = 'white'}>
            Support
          </a>
          <a
            href="#"
            style={buttonStyle}
            onMouseEnter={(e) => e.target.style.backgroundColor = '#15803d'}
            onMouseLeave={(e) => e.target.style.backgroundColor = '#16a34a'}
          >
            Get Started
          </a>
        </div>

      </div>
    </nav>
  );
}
